const AllInfo = (props) => {
    
    return(
        <div>
            {props.food.map((item, i) => {
                return <div key={i}>
                <p>{item.name}</p>
                <p>{item.cooking_effect}</p>
                </div>
            })}
        </div>
    )
}

export default AllInfo;
